import React, { Component } from 'react';
import B from './b';
import C from './c';
import { Say, Hello } from './home'
import { withRouter } from 'react-router-dom';

// import Router from './router';


class Show extends Component {

  render() {
    return (
      <div>
        <Say>
          <B.Provider />
        </Say>
        <Hello>
          <C.Provider />
        </Hello>
      </div>
    )
  }
}

export default withRouter(Show);
